import React, { useMemo, useState } from 'react';
import { KnowledgeTimelineEvent } from '../types';

interface Props {
  events: KnowledgeTimelineEvent[];
}

const formatDate = (event: KnowledgeTimelineEvent): string => {
  if (!event.date) {
    return 'ללא תאריך';
  }
  switch (event.datePrecision) {
    case 'day': {
      const parsed = new Date(event.date);
      return Number.isNaN(parsed.getTime()) ? event.date : parsed.toLocaleDateString('he-IL');
    }
    case 'month': {
      const [year, month] = event.date.split('-');
      return `${month}/${year}`;
    }
    case 'year':
      return event.date;
    default:
      return 'ללא תאריך';
  }
};

const MedicalTimeline: React.FC<Props> = ({ events }) => {
  const [showHidden, setShowHidden] = useState(false);
  const [openReferences, setOpenReferences] = useState<Record<string, boolean>>({});

  const visibleEvents = useMemo(
    () => (showHidden ? events : events.filter((event) => !event.hidden)),
    [events, showHidden],
  );

  const hasHidden = events.some((event) => event.hidden);

  if (!events.length) {
    return (
      <div className="rounded border border-slate-200 bg-white p-4 text-sm text-slate-500">
        לא נמצאו אירועים רפואיים לציר זמן.
      </div>
    );
  }

  return (
    <div className="rounded border border-slate-200 bg-white p-4 space-y-3">
      <div className="flex items-center justify-between">
        <h3 className="text-sm font-bold text-slate-700">ציר זמן רפואי</h3>
        {hasHidden && (
          <button
            type="button"
            className="text-xs text-blue-600 hover:text-blue-800"
            onClick={() => setShowHidden((prev) => !prev)}
          >
            {showHidden ? 'הסתר פריטים מוסתרים' : 'הצג פריטים מוסתרים'}
          </button>
        )}
      </div>
      {!visibleEvents.length ? (
        <div className="rounded border border-dashed border-slate-200 bg-slate-50 p-3 text-xs text-slate-500">
          אין אירועים להצגה. {hasHidden ? 'ניתן להציג פריטים מוסתרים באמצעות הכפתור.' : ''}
        </div>
      ) : (
        <ol className="space-y-3">
          {visibleEvents.map((event) => {
          const referenceCount = event.references?.length ?? 0;
          const isOpen = Boolean(openReferences[event.id]);
          return (
          <li key={event.id} className="border border-slate-100 rounded p-3 space-y-2">
            <div className="flex items-center justify-between text-xs text-slate-500">
              <span>{formatDate(event)}</span>
              <span className="font-semibold text-slate-700">{event.type}</span>
            </div>
            <div className="text-sm text-slate-800 whitespace-pre-line">{event.description}</div>
              {event.hidden && (
                <div className="text-xs text-amber-600">פריט מוסתר (כללי מדי)</div>
              )}
            {event.aggregatedCount && event.aggregatedCount > 1 && (
              <div className="text-xs font-semibold text-blue-600">
                כולל {event.aggregatedCount} אירועים
              </div>
            )}
              {referenceCount > 1 && (
                <button
                  type="button"
                  className="text-xs text-blue-600 hover:text-blue-800"
                  onClick={() =>
                    setOpenReferences((prev) => ({
                      ...prev,
                      [event.id]: !prev[event.id],
                    }))
                  }
                >
                  {isOpen ? 'הסתר מקורות' : `מקורות (${referenceCount})`}
                </button>
              )}
            {event.source?.snippet && (
              <p className="rounded bg-slate-50 p-2 text-xs text-slate-600">{event.source.snippet}</p>
            )}
            {(event.source?.page || event.source?.lineRange) && (
              <div className="text-xs text-slate-500">
                {event.source.page ? `עמוד ${event.source.page}` : ''}
                {event.source.lineRange ? ` · שורות ${event.source.lineRange[0]}-${event.source.lineRange[1]}` : ''}
              </div>
            )}
              {isOpen && referenceCount > 0 && (
                <ul className="space-y-1 rounded border border-slate-100 bg-slate-50 p-2 text-xs text-slate-600">
                  {event.references?.map((reference, index) => (
                    <li key={reference.id ?? `${event.id}-ref-${index}`}>
                      <div>{reference.description}</div>
                      {reference.source?.page && (
                        <div className="text-[11px] text-slate-500">
                          {reference.source.page ? `עמוד ${reference.source.page}` : ''}
                          {reference.source.lineRange
                            ? ` · שורות ${reference.source.lineRange[0]}-${reference.source.lineRange[1]}`
                            : ''}
                        </div>
                      )}
                    </li>
                  ))}
                </ul>
              )}
          </li>
          );
        })}
      </ol>
      )}
    </div>
  );
};

export default MedicalTimeline;
